function App() {
  return (
    <div >

      <BrowserRouter>

        <Routes>
          <Route path="/" element={<Loginpage/>}></Route>
          <Route path="/log" element={<Register />}></Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
